import React, { Component } from 'react';
import CanvasJSReact from '../../assets/canvasjs.react';
import "../Toggle.css";
import { Switch, Route, Link } from 'react-router-dom';
import Login from '../../login.component';
import home from '../../home';
import Axios from 'axios';
var CanvasJSChart = CanvasJSReact.CanvasJSChart;


//#region Style
const divStyle = {
	height: '550px',
	width : '950px',
	backgroundColor: '#FFFFFF',
	resize: 'horizontal',
	overflow: 'auto'
};

const divStyle2 = {
	height: '550px',
	width: '400px',
	backgroundColor: '#E7E7E7',
	resize: 'horizontal',
	overflow: 'auto'
};

const parentdivStyle = {
	backgroundColor : '#E6E6E6'
}  
//#endregion

class VoltageChart extends Component {
	constructor(props){
		super(props)
		this.state = {
			data : [],
			power : [],
			currentIndex: 0,
			path: "",
			SegNo: "-",
			distance: 0,
			dtt : "",
			variance : 0,
			cpa : 0,
			devices : [],
			clr : ["#FCC984","#FCC984","#FCC984","#FCC984","#FCC984","#FCC984","#FCC984"],
			toggle : true
		};
		this.toggleState = this.toggleState.bind(this);
	}

	
	toggleState() {
		this.setState({
			toggle: !this.state.toggle
		});
		console.log(this.state.toggle);
	}

	formatNumber (num) {
		return num.toString().replace(/(\d)(?=(\d{3})+(?!\d))/g, "$1,")
	}

	makeLabel(i,j){
		return this.state.power[i].PHASES[j].RMSVOLTAGE;
	}

	makeleftLabel(i,j){
		return this.makeLabel(i-1,j)+ this.makeLabel(i+1,j);
	}

	makeParentLabel(i,j){
		return this.makeleftLabel(i-2,j)+this.makeleftLabel(i+2,j)+
			this.makeLabel(i-2,j)+this.makeLabel(i+2,j);
	}

	componentDidMount(){
		Axios.get(process.env.REACT_APP_SEGMENTS_API+"segments",
		{
			headers: {
				'Access-Control-Allow-Origin': '*',
				},
		},
		{
			withCredentials : true
		}
		).then(response=>{
			this.setState({
				data : response.data
			});
		});

		Axios.get(process.env.REACT_APP_POWER_API+"power",
		{
			headers: {
				'Access-Control-Allow-Origin': '*',
				},
		},
		{
			withCredentials : true
		}
		).then(response=>{
			this.setState({
				power : response.data
			})
		});
	}

	render() {
		
		const options = {
			animationEnabled: true,
			backgroundColor : "#E7E7E7",
			theme: "light2",
			width: 400,
			height: 150,
			axisY: {
				includeZero: false,
				gridDashType: "dot",
				lineDashType: "dot",
				interval: 1000
			},
			axisX: {
				gridDashType: "dot",
				lineDashType: "dot",
				prefix: "",
				interval: 6,
				intervalType : "hour",
				valueFormatString: "hh:mm tt"
			},
			data: [{
				type: "line",
				color: "#6D2A00",
				dataPoints: [
					{ x: new Date(2020,1,19,6), y: 2600 }, 
					{ x: new Date(2020,1,19,9), y: 1900 }, 
					{ x: new Date(2020,1,19,12), y: 2800 }, 
					{ x: new Date(2020,1,19,15), y: 5300 }, 
					{ x: new Date(2020,1,19,18), y: 2400 }, 
					{ x: new Date(2020,1,19,21), y: 3900 }, 
					{ x: new Date(2020,1,19,24), y: 2200 }, 
					{ x: new Date(2020,1,20,3), y: 4000 }, 
					{ x: new Date(2020,1,20,6), y: 5100 }, 
					{ x: new Date(2020,1,20,9), y: 1700 }
				]
